package LeetCode.round3;

import java.util.*;

/**
 * 240823 Easy
 * @author Zhu Xiuwei
Given a string s and a non-empty string p, find all the start indices of p's anagrams【相同字母异序词】 in s.
Strings consists of lowercase English letters only and the length of both strings s and p will not be larger than 20,100.
The order of output does not matter.

Example 1:
Input:
s: "cbaebabacd" p: "abc"
Output:
[0, 6]
Explanation:
The substring with start index = 0 is "cba", which is an anagram of "abc".
The substring with start index = 6 is "bac", which is an anagram of "abc".
Example 2:

Input:
s: "abab" p: "ab"
Output:
[0, 1, 2]
Explanation:
The substring with start index = 0 is "ab", which is an anagram of "ab".
The substring with start index = 1 is "ba", which is an anagram of "ab".
The substring with start index = 2 is "ab", which is an anagram of "ab".
 */
public class P438_FindAllAnagramsInAString {

    /**
     * AC: 73ms Beats 25.34%, Memory 45.89MB Beats 11.04%
     * 思路： 依次判断s的 p 长度的 SubString tmp 是否和p构成anagram
     * 判断思路是对比它俩的map是否完全一样。map结构： k: 字符串里的某字母， v: 此字母在字符串里出现的次数
     * ！！！ 需要做一个优化，否则会超时： tmp字符串的Map不是每次根据sub string tmp每次都重新生成，而是根据进出的字符串，动态调整tmp map。这样就不会超时了。
     */
    public List<Integer> findAnagrams(String s, String p) {
        List<Integer> res = new ArrayList<>();
        Map<Character, Integer> pMap = genMap(p);
        Map<Character, Integer> sMap = null;

        int compareTimes = s.length() - p.length() + 1;
        for (int i = 0; i < compareTimes; i++) {
            String tmp = s.substring(i, i + p.length());
            if(sMap == null){   //是第一次比较
                sMap = genMap(tmp);
            }else {
                //！！！优化1：sMap(tmp map)不是每次根据tmp来重新生成，而是根据进出的首末字符串，动态调整sMap
                char lastExitChar = s.charAt( i - 1);   //本轮tmp字符串的上一个char(刚出去的char)
                char newEnterChar = s.charAt(i + p.length() - 1);   //本轮tmp字符串的最后一个char(新进来的char)
                if(lastExitChar != newEnterChar){   //俩char不一样，就需要调整tmp map
                    int lastCount = sMap.get(lastExitChar) - 1;
                    if(lastCount == 0){
                        sMap.remove(lastExitChar);
                    }else {
                        sMap.put(lastExitChar, lastCount);
                    }
                    sMap.put(newEnterChar, sMap.getOrDefault(newEnterChar, 0) + 1);
                }
            }
            //TODO: 优化2： 如果进出的字符串一样，就不用每次调用islAnagrams方法。但这个优化懒得写了。
            if(islAnagrams(pMap, sMap)){
                res.add(i);
            }
        }
        return res;
    }

    //根据字符串生成map. k: 字符串中的字符， v: 出现次数
    private Map<Character, Integer> genMap(String s){
        Map<Character, Integer> res = new HashMap<>();
        for (int i = 0; i < s.length(); i++) {
            char c = s.charAt(i);
            int count = res.getOrDefault(c, 0);
            res.put(c, ++ count);
        }
        return res;
    }

    /**
     * 判断两个map是否是Anagrams。
     * 思路就是判断俩map的kv是否完全一样。
     */
    private boolean islAnagrams(Map<Character, Integer> map1, Map<Character, Integer> map2){
        if(map1.size() != map2.size())
            return false;
        Iterator<Character> it = map1.keySet().iterator();
        while (it.hasNext()){
            char c = it.next();
            if(!map2.containsKey(c))
                return false;
            if(!map1.get(c).equals(map2.get(c)))    //！！！注意,比较的是Integer不是int，不能用==比较，所以用的equals方法。也可以用==比较俩Integer的intValue()。
                return false;
        }
        return true;
    }

    public static void main(String[] args) {
        P438_FindAllAnagramsInAString p = new P438_FindAllAnagramsInAString();
        System.out.println(p.findAnagrams("abab", "ab"));	//[0,1,2]
        System.out.println(p.findAnagrams("cbaebabacd", "abc"));	//[0,6]
        System.out.println(p.findAnagrams("abacbabc", "abc"));	//[1,2,3,5]
        //s: 10000个a b 10000个a,  p: 10000个a。输出：//[0,10001]
        System.out.println(p.findAnagrams("",
                ""));
        //s和p都全部都是a-z组成的循环。 如果不做优化1，以下case会超时
        System.out.println(p.findAnagrams("",
                ""));	//[0,10001]
    }
}
